INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3564700698679', 'Poulet Crudités Parmesan (Pâtes, Œufs, Salade)', 'SALADE COMPOSÉE 89,1 % : mélange de pâtes alimentaires cuisinées 42,1 % (minis conchiglie cuites 27,2 % (eau, semoule de _blé_ dur de qualité supérieure, épices, sel, arômes naturels), carottes râpées 12,6 %, huile d\'olive vierge extra, huile de colza, persil, sel) ; quartiers d\'_œufs_ durs 15,8 % (_œuf_, acidifiants : acide citrique - acide acétique, sel) ; salades mélangées 15,8 % (laitue et chicorée en proportion variable) ; émincé de filet de poulet traité en salaison cuit rôti 14 % (filet de poulet 13,7 %, sel, amidon de tapioca, dextrose) ; tomates cerise 8,8 % ; _parmesan_ râpé 3,5 %. (Pourcentages exprimés sur la salade composée). SAUCE AU VINAIGRE BALSAMIQUE 6,2 % : huile de colza ; vinaigre balsamique 25 % (vinaigre de vin (dont _sulfites_), moût de raisin concentré et cuit, colorant : caramel E150d) ; huile d\'olive vierge extra. (Pourcentages exprimés sur la sauce). BÂTONNETS GRILLÉS AU PARMESAN ET ORIGAN 4,7 % : farine de _blé_ ; _parmesan_ râpé 9,5 % ; huile de tournesol ; huile d\'olive ; origan déshydraté 2,3 % ; sel ; levure. (Pourcentages exprimés sur les bâtonnets grillés).', 'https://static.openfoodfacts.org/images/products/356/470/069/8679/front_fr.27.400.jpg', '11.9', '3.7', '13.8', '4.5', '1.6', '8.3', '0.55', '0.216535433070866', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3564700698716', 'Speck Crudités Mozzarella (Pâtes, Salade)', 'SALADE COMPOSÉE 89,1 % : mélange de pâtes alimentaires cuisinées 62,4 % (minis conchiglie cuites 32 % (eau, semoule de _blé_ dur de qualité supérieure, épices, sel, arômes naturels), minis torsades cuites aromatisées à la tomate et à la betterave 24,7 % (eau, semoule de _blé_ dur de qualité supérieure, tomate, betterave), fèves de _soja_, huile d\'olive vierge extra, huile de colza, basilic, sel) ; salades mélangées 15.8 % (laitue et chicorée en proportion variable) ; tomates cerise 8,8 % ; mozzarella 7 % (_lait_ de vache pasteurisé, sel, présure animale, coagulant enzymatique, correcteur d\'acidité : acide citrique) ; jambon speck fumé 6 % (viande de porc, sel, épices, dextrose, arômes naturels, conservateurs : E 250, E 251). (Pourcentages exprimés sur la salade composée).  SAUCE AU VINAIGRE BALSAMIQUE 6,2 % : huile de colza ; vinaigre balsamique 25 % (vinaigre de vin (dont _sulfites_), moût de raisin concentré et cuit, colorant : caramel E150d) ; huile d\'olive vierge extra. (Pourcentage exprimé sur la sauce). BÂTONNETS GRILLÉS AU PARMESAN ET ORIGAN 4, 7 % : farine de _blé_ ; _parmesan_ râpé 9,5 % ; huile de tournesol ; huile d\'olive ; origan déshydraté 2,3 % ; sel ; levure. (Pourcentages exprimés sur les bâtonnets grillés).  ', 'https://static.openfoodfacts.org/images/products/356/470/069/8716/front_fr.10.400.jpg', '8.3', '1.7', '14.4', '1.9', '1.6', '6.3', '0.475', '0.187007874015748', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3564700698754', 'Dej\'froid', 'Salade composée : mélange de pâtes alimentaires cuisinées 43% (conchiglie cuites aromatisées au curcuma 22,4% (eau, semoule de blé dur de qualité supérieure, oeufs, curcuma) - mini torsades cuites aromatisées à la tomate et à la betterave 18,8% (eau, semoule de blé dur de qualité supérieure, tomate 0,2%, betterave 0,03%), huile d\'olive vierge extra, huile de colza, basilic, sel) ; salades mélangées 17,3% ; quartiers d\'?ufs durs 17,3% ; jambon cuit supérieur 10,8% (jambon de porc (origine : France), eau, sel, dextrose, sirop de glucose, arôme, antioxydant : E316 ; conservateur : E250) ; emmental 5,8% ; tomates cerises 5,8%. (% exprimés sur la salade composée). Mini quatre-quarts : farine de blé ; oeufs entiers 27% ; sucre ; beurre concentré 22,5% (soit en beurre reconstitué 27%) ; stabilisant : glycérol ; émulsifiant : E471 ; poudres à lever : E450, E500 ? lait écrémé en poudre ; sel ; arôme naturel de vanille avec autres arômes naturels (dont lait) ; colorant : caroténoïdes. (% exprimés sur le mini quatre-quarts). Sauce au vinaigre balsamique : huile de colza ; vinaigre balsamique 25% (vinaigre de vin (dont sulfites), moût de raisin concentré et cuit, colorant : E150d) ; huile d\'olive vierge extra. (% exprimé sur la sauce). Sachet de biscuits feuilletés salés tomate et basilic : farine de froment (gluten) ; beurre ; concentré de tomates 9% ; levure ; sel ; lait écrémé en poudre ; tomate en poudre 1% ; basilic séché 0,6% ; ail en poudre ; extrait de malt d\'orge (gluten) ; piment en poudre ; poudre d\'acérola sur fécule de manioc. (% exprimés sur les biscuits feuilletés). Traces de fruits à coque.', 'https://static.openfoodfacts.org/images/products/356/470/069/8754/front_fr.4.400.jpg', '11', '3.4', '15', '4.5', '1.6', '7.6', '0.48', '0.188976377952756', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
