VALUES ('3564700721766', 'Cordon Bleu de Poulet', 'Préparation de viande de filet de poulet traitée en salaison 55% : viande de filet de poulet 38%, eau, fibre de _blé_, dextrose, sel, arôme, arômes naturels de poivre, protéines de _blé_, antioxydant : E316. Panure 24% : farine de _blé_ ; eau épices ; sel ; levure ; conservateurs : E200, E202. Jambon de dinde cuit standard 10% : viande de dinde 8% ; eau ; sirop de glucose ; dextrose ; sel ; stabilisants : E451, E450 protéines de _blé_ ; arômes ; antioxydant : E316 ; conservateur : E250. Emmental fondu 10% : _emmental_ 5% ; _fromages_ ; eau ; _beurre_ ; _lait_ écrémé en poudre ; protéines de _lait_ ; sels émulsifiants : E339, E341, E450, E452 ; sel ; arôme. Huile d tournesol 1%. Pourcentage exprimé sur le produit total avant friture.', 'https://static.openfoodfacts.org/images/products/356/470/072/1766/front_fr.8.400.jpg', '14', '3.7', '10', '2', '1.9', '15', '1.7', '0.669291338582677', '', '0');

