VALUES ('3564700782590', 'Tasty Crust', 'Pâte 52,2% : farine de _blé_, eau, dextrose, huile de colza, sel, levure. Garniture 47,8% : mozarella (_lait_) 11%, _fromage_ fondu 10% (_fromage_, eau, protéines de _lait_, poudre de _lait_ écrémé, sel de fonte : E331), _lait_ fermenté, _crème_ fraîche, cheddar (_lait_) (dont colorant : rocou) 4,4%, oignons 3,3%, emmental (_lait_) 2,2%, huile de colza, stabilisant : E461, farine de _blé_, sel, ail, amidon de pomme de terre, poivre. Les pourcentages sont exprimés sur le produit total.', 'https://static.openfoodfacts.org/images/products/356/470/078/2590/front_fr.12.400.jpg', '10.6', '5.9', '28.9', '7.6', '2', '11.9', '1.03', '0.405511811023622', '', '0');

